import React from 'react';
import ReactDOM from 'react-dom';
import ContactBox from './components/ContactBox';
import App from './App';

const config = {
    api: `${process.env.REACT_APP_API}`,
    title: 'Contact Me',
    successMessage: 'Thank you for contcting me.',
    errorMessage: 'Sorry we have some problems.',
    fields:{
      name: '',
      email: '',
      message: ''
    },
    fieldsConfig:  [
     { id: 1, fieldName: 'name', type: 'text', isRequired: true , klassName:'name-field'},
     { id: 2, fieldName: 'email', type: 'email', isRequired: true , klassName:'email-field'},
     { id: 3, fieldName: 'message', type: 'textarea', isRequired: true , klassName:'message-field'}
    ]
  }

ReactDOM.render(<ContactBox config={config} /> , <App />, document.getElementById('root'));

